    "role":"Web-Lead"
  },
  {
    "name":"Aryan Tiwari",
    "role":"Web-Lead"
  },
  {
    "name":"Aryan Tiwari",
    "role":"Web-Lead"
  }
]

const Team = () => {
  return (
    <div className={styles.team_wrapper}>
      <div className={styles.bgname}> Our Team</div>

   {data.map((e)=><Teamcard img = {e.img} name={e.name} role={e.role}/>)}
   </ div>
  )
}

export default Team
